INSERT INTO `wp_posts` VALUES (1,1,'2017-06-09 16:07:20','2017-06-09 16:07:20','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','trash','open','open','','hello-world__trashed','','','2017-06-09 17:17:41','2017-06-09 17:17:41','',0,'http://localhost/wordpress/?p=1',0,'post','',1),(2,1,'2017-06-09 16:07:20','2017-06-09 16:07:20','[et_pb_section bb_built=\"1\" admin_label=\"Section\" custom_padding=\"0px|0px|0px|0px\" fullwidth=\"on\" _builder_version=\"3.0.47\"][et_pb_fullwidth_header admin_label=\"Fullwidth Header\" _builder_version=\"3.0.51\" background_color=\"#7ebec5\" text_orientation=\"left\" header_fullscreen=\"off\" header_scroll_down=\"off\" image_orientation=\"center\" background_layout=\"light\" content_orientation=\"center\" custom_button_two=\"off\" button_two_letter_spacing=\"0\" button_two_icon_placement=\"right\" button_two_letter_spacing_hover=\"0\" custom_button_one=\"off\" button_one_letter_spacing=\"0\" button_one_icon_placement=\"right\" button_one_letter_spacing_hover=\"0\"]\r\n\r\n<h1><img class=\"wp-image-87 alignnone size-medium\" style=\"float: left;\" src=\"http://localhost/wordpress/wp-content/uploads/2017/06/cropped-head-eyes-brown-blue-man-face-cartoon-beard-300x300.png\" alt=\"\" width=\"120\" height=\"120\" /></h1>\r\n<h1 style=\"text-align: center;\"><span style=\"font-weight: normal; font-size: xx-large; color: #ffffff;\">Using Artifical Intelligence to create smarter software.</span></h1>\r\n<p style=\"text-align: center; margin-top: 10px;\"><span style=\"color: #ffffff; font-size: 1.5em;\">Charlie Sanders</span><br> <span style=\"color: #ffffff;\"> Austin, Texas</span> <br><span style=\"color: #ffffff;\"> 698-2009</span></p>\r\n\r\n[/et_pb_fullwidth_header][/et_pb_section][et_pb_section bb_built=\"1\" admin_label=\"section\" custom_padding=\"0px|0px|0px|0px\" fullwidth=\"on\" _builder_version=\"3.0.51\"][et_pb_fullwidth_header admin_label=\"Fullwidth Header\" _builder_version=