nd we will refund your purchase right away. Our goal has always been to create a happy, thriving community. If you are not thrilled with the product or are not enjoying the experience, then we have no interest in forcing you to stay an unhappy member.[/et_pb_toggle][et_pb_toggle admin_label=\"Toggle\" title=\"What are Photoshop Files?\" open=\"off\"]Elegant Themes offers two different packages: Personal and Developer. The Personal Subscription is ideal for the average user while the Developers License is meant for experienced designers who wish to customize their themes using the original Photoshop files. Photoshop files are the original design files that were used to create the theme. They can be opened using Adobe Photoshop and edited, and prove very useful for customers wishing to change their theme\'s design in some way.[/et_pb_toggle][et_pb_toggle admin_label=\"Toggle\" title=\"Can I upgrade after signing up?\" open=\"off\"]Yes, you can upgrade at any time after signing up. When you log in as a \"personal\" subscriber, you will see a notice regarding your current package and instructions on how to upgrade.[/et_pb_toggle][et_pb_toggle admin_label=\"Toggle\" title=\"Can I use your themes with WP.com?\" open=\"off\"]Unfortunately WordPress.com does not allow the use of custom themes. If you would like to use a custom theme of any kind, you will need to purchase your own hosting account and install the free software from WordPress.org. If you are looking for great WordPress hosting, we recommend giving HostGator a try.[/et_pb_toggle][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fullwidth=\"off\" specialty=\"off\" background_image=\"https://elegantthemesimages.com/images/premade/d2-placeholder-1920.png\" inner_shadow=\"on\" parallax=\"off\"][et_pb_row][et_pb_column type=\"4_4\"][et_pb_cta admin_label=\"Call To Action\" title=\"Don\'t Be Shy\" button_url=\"#\" button_text=\"Get In Touch\" use_background_color=\"off\" background_color=\"#108bf5\" backgroun